import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Component } from "react";
import App from './app/containers/App';
import {UserProvider} from "./app/contexts/UserContext";

ReactDOM.render(  
    <MyProvider>
      <App />
    </MyProvider>,
    document.getElementById('root')    
);
